import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <ul className="nav-links">
        <li><a href='/'/>Monitoring</li>
        <li>Product</li>
        <li>User</li>
        <li>Service</li>
      </ul>
    </nav>
  );
};

export default Navbar;
